import React from 'react';
import { 
  BsSearch, 
  BsBarChart, 
  BsGear, 
  BsFileText,
  BsFilter,
  BsSave,
  BsTrash 
} from 'react-icons/bs';

// Exportando os componentes como funções simples
export const SearchIcon = React.memo((props) => <BsSearch {...props} />);
export const ChartIcon = React.memo((props) => <BsBarChart {...props} />);
export const GearIcon = React.memo((props) => <BsGear {...props} />);
export const FileIcon = React.memo((props) => <BsFileText {...props} />);
export const FilterIcon = React.memo((props) => <BsFilter {...props} />);
export const SaveIcon = React.memo((props) => <BsSave {...props} />);
export const TrashIcon = React.memo((props) => <BsTrash {...props} />);
